  return (
    <div>
      <ul>
        <li>
          {props.taskTitle}
          <form action="" className="d-flex">
            <label htmlFor="done"></label>
            <input
              type="checkbox"
              name="done"
              id="done"
              checked={props.completed}
              onChange={props.toggleComplete}
            />
          </form>
          <button className="btn btn-danger" onClick={props.handleDelete}>
            Delete
          </button>
        </li>
      </ul>
    </div>
  )
}

export default Task
